import NavBar from './NavBar';
function Home(){
    return(
        <div>
            <NavBar />
            <div class="home">
                <div class="home-info">
                    <div class="home-img">
                        <img src='https://res.cloudinary.com/dhgfsshq4/image/upload/v1705444035/hacks%206.0/hover_craft_kgbfdt.webp'></img>
                    </div>
                    <p>
                        A passionate Developer having an experience in Data Analytics, Machine Learning and Web Development 
                        and want to develop sustainable and scalable social and technical systems to create impact.
                    </p>
                </div>
                {/* <img class="rocket" src='https://res.cloudinary.com/dhgfsshq4/image/upload/v1705440728/hacks%206.0/Group_5254_right_yqs3kf.png'></img> */}
            </div>
        </div>
    )
}
export default Home;
